" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Smoking and cardiovascular risk in diabetes mellitus",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
