"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Complete fracture reduction: Realignment",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 418px; height: 454px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panels A and B) Once length has been reestablished, the distal fragment is flexed into the correct position. Alignment is checked by determining the position of the fragments with the thumb and forefingers of each hand.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Waters PM, Mih AD. Fractures of the distal radius and ulna. In: Rockwood and Wilkins' Fractures in Children, 6th ed, Beaty JH, Kasser JR (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
