var title_f5_4_5197="Choice of influenza vaccine for children";
var content_f5_4_5197=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F67562&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F67562&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Choice of influenza vaccine for children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Category",
"       </td>",
"       <td class=\"subtitle1\">",
"        Type of influenza vaccine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 to 6 months",
"       </td>",
"       <td>",
"        Vaccine not licensed for this age group; household contacts and out-of-home caregivers should receive&nbsp;IIV or LAIV*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        6 to 24 months",
"       </td>",
"       <td>",
"        IIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;24 months",
"       </td>",
"       <td>",
"        IIV&nbsp;or LAIV*",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Chronic medical disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pulmonary (including asthma in children of all ages and history of wheezing in the previous 12 months for children aged 2 through 4 years)",
"       </td>",
"       <td rowspan=\"8\">",
"        IIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cardiovascular disease (including pulmonary hypertension, but excluding systemic hypertension)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Congenital heart disease with physiologically significant abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Renal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hepatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hematologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Metabolic (including diabetes mellitus)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Neurologic, neuromuscular, and neurodevelopmental disorders (including disorders of the brain, spinal cord, peripheral nerve and muscle such as cerebral palsy, epilepsy, stroke, intellectual disability [mental retardation], moderate to severe developmental delay, muscular dystrophy, or spinal cord injury), particularly those that compromise respiratory function or the handling of secretions, or that increase the risk of aspiration",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Other conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Immunosuppression, including immunosuppression due to medications or human immunodeficiency virus",
"       </td>",
"       <td>",
"        IIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Long-term aspirin or salicylate therapy (for children 6 months to 18 years of age)",
"       </td>",
"       <td>",
"        IIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Residents of chronic-care facilities",
"       </td>",
"       <td>",
"        IIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Women who will be pregnant during the influenza season",
"       </td>",
"       <td>",
"        IIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Severe obesity (body mass index [BMI] &ge;40 for adults or BMI &gt;2.33 standard deviations above the mean for children)",
"       </td>",
"       <td>",
"        IIV&nbsp;or LAIV*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Native Americans, including Alaska Natives",
"       </td>",
"       <td>",
"        IIV&nbsp;or LAIV*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Household or close contact of infant younger than six months or individual with chronic medical disorder or other condition with increased risk of severe or complicated influenza infection, except severely immunocompromised hospitalized person who requires protected environment",
"       </td>",
"       <td>",
"        IIV&nbsp;or LAIV*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Contact of severely immunocompromised hospitalized person who requires protected environment",
"       </td>",
"       <td>",
"        IIV",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IIV:&nbsp;inactivated influenza vaccine; LAIV: live-attenuated influenza vaccine.",
"     <br>",
"      * LAIV may be administered to individuals who are healthy, nonpregnant, and 2 through 49 years of age.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
